import './App.css';


function App() {
  return (
    <div className="App">
      <div className="navbar">
        <span className="navbar-logo" style={{marginTop : "50px"}}>
            <img src="./logo.png" id="logo-link" alt ="None" style={{height : "80px", marginLeft : "20px"}}/>
        </span>
      </div>

    </div>
  );
}

export default App;
